import './App.css';

import React, { Component } from 'react'
import NavBar from './components/NavBar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


export default class App extends Component {
 pageSize =5;

  render() {
    return (
      <div>
         <Router>
        <NavBar/>
        <Switch>
        <Route exact path="/"><News key="general"pageSize={this.page.Size} country="in" category="general"/></Route> 
          <Route exact path="/business"><News key="business"pageSize={this.page.Size} country="in" category="business"/></Route> 
          <Route exact path="/entertainment"><News key="entertainment"pageSize={this.page.Size} country="in" category="entertainment"/></Route> 
          <Route exact path="/general"><News key="general"pageSize={this.page.Size} country="in" category="general"/></Route> 
          <Route exact path="/health"><News key="health"pageSize={this.page.Size} country="in" category="health"/></Route> 
          <Route exact path="/science"><News key="science"pageSize={this.page.Size} country="in" category="science"/></Route> 
          <Route exact path="/sports"><News key="sports"pageSize={this.page.Size} country="in" category="sports"/></Route> 
          <Route exact path="/technology"><News key="technology"pageSize={this.page.Size} country="in" category="technology"/></Route>
        </Switch>
        </Router>
      </div>
    )
  }
}
